import React from 'react'
import Link from 'next/link'

import { StyledLink } from './StyledComponents/StyledLink'


export const AppRouterLink = ({ href, children, ...rest }) => {
  return (
    <Link href={ href } >
      <StyledLink { ...rest }>
        { children }
      </StyledLink>
    </Link>
  )
}
